import location from './images/location.png';
import duration from './images/duration.png';
import date from './images/date.png';
import pound from './images/pound.png';
import internetPage from './images/internet.png';
import code from './images/code.png';

const CardComp = (props) => {
    return (
        <div className="card">
            <img src={companyLogo} alt="company logo" />
            <div className="cardDetails">
                 <h3 className="cardTitle">Quantity Surveying Management Trainee Programme with SES</h3>
                 <div className="leftCard">
                     <p><img src={location} alt="location"/> London</p>
                     <p><img src={code} alt="code"/> +44</p>
                     <p><img src={internetPage} alt="internetPage"/>www.unicorn</p>
                 </div>

                 <div className="rightCard">

                 </div>
            </div>
        </div>
    )
}

export default CardComp;
